import React, { Component } from "react";
import './App.css';

class MintLedger extends Component {
  render() {
    if (this.props.mintHistory) {
      let { time, tokenAddress } = this.props.mintHistory[0]
      time = new Date(time * 1000)
      console.log(time)
      console.log(tokenAddress)
    }
    return (
        <h1>
          Ledger
        </h1>
    );
  }
}

export default MintLedger;
